import TVPresenter from "./TVPresenter";

export default class extends React.Component{
    state = {
        topRated: null,
        popular: null,
        airingToday: null,
        loading: null,
        error: null,
    };

    render() {
        const { topRated, popular, airingToday, loading, error} = this.state; 
    }
}
